INSERT INTO `phaos_npcs` VALUES (2, 'Morin', 'Elf', 'images/icons/npcs/npc_4.gif', 6142, 'The priests of the Qu-Nai captured a balor in Wath and brought it back here.\r\n<p>Visit the arena and you may be chosen to fight the demon.', 0);
